import React from 'react';
import CosForm from '../../form/CosForm'; // Ensure the path is correct
import Logo2 from '../../../assets/Logo2.png';

const Login = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
  };

  return (
    <CosForm title="Login" onSubmit={handleSubmit}>
      <div className="text-center mb-6">
        <img src={Logo2} alt="Logo" className="h-28 w-32 mx-auto" />
      </div>
      <div>
        <label className="block text-white">Username</label>
        <input type="text" className="w-full px-4 py-2 mt-2 border rounded-md focus:outline-none focus:ring-1 focus:ring-purple-600" placeholder="Enter your username" />
      </div>
      <div className="mt-4">
        <label className="block text-white">Password</label>
        <input type="password" className="w-full px-4 py-2 mt-2 border rounded-md focus:outline-none focus:ring-1 focus:ring-purple-600" placeholder="Enter your password" />
      </div>
      <div className="flex flex-col mt-4">
        <button type="submit" className="px-4 py-2 bg-blue-800 text-white rounded-md">Log In</button>
        <p className="mt-4 text-sm text-white">Lupa Password?</p>
        <p className="mt-4 text-sm text-white">
          Klik disini!! <br />
          <a href="/register" className="text-blue-600">Reset Password</a>
        </p>
      </div>
    </CosForm>
  );
};

export default Login;
